import React, { useState, useEffect } from 'react';

function FetchDataa() {

    const [backendData, setBackendData] = useState(({}))

    const handleFetch = () => {
        fetch('http://localhost:4000/stories')           //api for the get request
        .then(response => response.json())
        .then(data => {
            setBackendData(data)
        })
    }

    useEffect(()=> {
        fetch('http://localhost:4000/stories').then(
            response => response.json()
        ).then(
            data => {
                setBackendData(data)
            }
        )
    }, [])


  return (
    <div>
        <p>{backendData}</p>
    </div>
  )
}

export default FetchDataa;
